import React, { Component } from 'react';
import './Header.css';

class Header extends Component {
  render() {
    return (
      <div className="header">
        <p className="header-text"> D . M . S T U D I O </p>

        <div className="navigation__fullscreen">
                <input type="checkbox" checked={props.checked} onChange={props.handleManageCheckBox} className="navigation__checkbox" id="navi-toggle"/>
                <label htmlFor="navi-toggle" className="header__button">
                    <span className="navigation__icon">&nbsp;</span>
                </label>
                <div className="navigation__background">&nbsp;</div>

                <nav className = "navigation__nav">
                    <ul className = "navigation__list">
                        <li className="navigation__item" ><a href="#" className="navigation__link">About</a></li>
                        <li className="navigation__item" ><a href="#" className="navigation__link">Menu</a></li>
                        <li className="navigation__item" ><a href="#" className="navigation__link">Reviews</a></li>
                        <li className="navigation__item" ><a href="#" className="navigation__link">Contact</a></li>
                        </ul>
                </nav>
          </div>
      </div>
    );
  }
}

export default Header;
